import React from 'react';

class Recipe {
  constructor(jsonResponse) {
    this.ID = jsonResponse.id;
    this.category = jsonResponse.category;
    this.name = jsonResponse.name;
    this.description = jsonResponse.description;
    this.servings = jsonResponse.servings;
    this.caloriesPerServing = jsonResponse.caloriesPerServing;
    this.notes = jsonResponse.notes;
    this.author = jsonResponse.author;
    this.ingredients = jsonResponse.ingredients;
    this.steps = jsonResponse.steps;
    this.tags = jsonResponse.tags;
  }

  render() {
    return (
      <div>
        <h2>Recipe Details</h2>
        {/* Render the recipe details */}
      </div>
    );
  }
}

export default Recipe;
